import './App.css';
import { BrowserRouter as Router,Route, Routes } from 'react-router-dom';
import UserLoginPage from './components/UserLoginPage';

function App() {
  return (
    <div className="App">
      <Router>
          <HeaderComponent/>
          <div className="container">
            <Routes>
            <Route path='/' element ={<UserLoginPage/>}/>

            </Routes>
          </div>
      </Router>
    </div>
  );
}

export default App;
